import React, { useState, useEffect } from "react";
import Axios from "axios";
import "../../stylesheets/userLoginForm.css";

function NavBar() {
    const [user, setUser] = useState(null);

    useEffect(() => {
        Axios({
            method: "GET",
            withCredentials: true,
            url: "http://localhost:4000/",
        }).then((res) => {
            setUser(res.data);
        });
    }, [])

    return (
        <div className="navBarContainer">
            <div className="navBarLeft">
                <img className="navBarLogo" src='/logo.png' alt="" />

                <a className="leftLinks" href="/">Home</a>
                <a className="leftLinks" href="/instructions">How Does it Work?</a>
                <a className="leftLinks" href="/dashboard">Dashboard</a>
                <a className="leftLinks" href="/contact">Contact Us</a>
            </div>

            <div className="navBarRight">
                {user ? (<p className="rightLinks">Logout</p>) : (
                    <div className="navBarContainer">
                        <p className="rightLinks">Login</p>
                        <p className="rightLinks">Register</p>
                    </div>
                )}

            </div>
        </div>
    );
}

export default NavBar;
